@Entry
@Component
struct ParentComponent {
  @State parentCount: number = 0;

  build() {
    Column() {
      Text(this.parentCount.toString())
      LinkChildComponent({ target: this.parentCount })
    }
  }
}

@Component
struct LinkChildComponent {
  @Link target: number = 0;

  build() {
    Column() {
      Button()
        .onClick(() => {
          this.target++;
        })
    }
  }
}

interface User {
  name: string;
  age: number;
